●カーメイトのクルマを愛する大人のための上質なフレグランスブランド ブラング アヴァン エアリキッド リフィル モーニングデュー H712<br>●高濃度リキッドを使用したエアコン吹出口取付タイプで、調香機能付きの芳香剤<br>●ブラング アヴァン エアリキッドシリーズに対応した詰め替え用フレグランスボトル<br><br>☆ブラング アヴァン ラインアップ<br>グランリキッドタイプ → L551 / L552 / L553<br>リキッドタイプ → L511 / L512 / L513 / L514<br>ゲルタイプ → G1091 / G1092 / G1093 / G1094<br>ソリッドタイプ → G1121 / G1122 / G1123 / G1124<br>エアリキッドタイプ → H701 / H702 / H703 / H704<br>エアリキッドタイプ詰め替え用ボトル → H711 / H712 / H713 / H714<br><br>【仕様】<br>品名：BLANG AVAN AIR LIQUID REFILL MORNING DEW<br>カラー：クリア(CLEAR)<br>製品重量：52g<br>製品サイズ：H73×W32×D32(mm)<style type="text/css">
